import "./App.css";
import { Route } from "react-router-dom";
import Home from "./pages/Home";
import Cart from "./pages/Cart";

function App() {
	return (
		<div>
			<Route Path="/" exact>
				<Home />
			</Route>
			<Route Path="/cart">
				<Cart />
			</Route>
			<Route Path="/add-item">
				<div>Additem mis ple valmis</div>
			</Route>
		</div>
	);
}

export default App;
